import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import AdminPlans from './AdminPlans';

function AdminDashboardHome() {
  return (
    <div className="bg-white p-4 rounded shadow">Welcome, Admin!</div>
  );
}



function AdminDiscounts() {
  return <div className="bg-white p-4 rounded shadow">Discounts Management (CRUD UI here)</div>;
}

function AdminAnalytics() {
  return <div className="bg-white p-4 rounded shadow">Analytics Dashboard (Charts here)</div>;
}

function AdminDashboard() {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Admin Dashboard</h1>
      <Routes>
        <Route path="" element={<AdminDashboardHome />} />
        <Route path="plans" element={<AdminPlans />} />
        <Route path="discounts" element={<AdminDiscounts />} />
        <Route path="analytics" element={<AdminAnalytics />} />
        <Route path="*" element={<Navigate to="." />} />
      </Routes>
    </div>
  );
}

export default AdminDashboard;
